import React from "react";
import Menu from './side-bar/file-menu';
import ListCtrl from "./side-bar/list-ctrl";

const SideBar = () => {
    return(
        <div className="side-bar">
            <Menu></Menu>
            <ListCtrl></ListCtrl>
        </div>
    )
}

export default SideBar;
